import React from "react";
import OrangeArrow from "../assets/images/orange-arrow.svg";

function WhyApply() {
  return (
    <div className="whyapply-section">
      <div className="apply-left-container">
        <h2>Why You Should Apply</h2>
      </div>
      <div className="apply-right-container">
        <div className="apply-item">
          <img className="orange-arrow" src={OrangeArrow} alt="orange-arrow" />
          <p>
            If you’re looking to power up your own portfolio, this program is a
            great way to do so! Participants from last year’s Level Up were able
            to create a polished case study of their project and showcase it on
            their portfolio.{" "}
          </p>
        </div>
      </div>
    </div>
  );
}

export default WhyApply;
